import React from "react";
import "./experience.scss"; // Assurez-vous d'avoir le bon chemin vers votre fichier CSS

const Experience = ({ experience1, experience2 }) => {
  return (
    <div className="experience" >
      <div className="experience-card">
        <div className="experience-image">
          <img src={experience1.companylogo} alt={experience1.company} />
        </div>
        <div className="experience-details">
          <h3>{experience1.company}</h3>
          <p>{experience1.role}</p>
          <p>{experience1.date}</p>
          <ul>
            {experience1.descBullets.map((bullet, index) => (
              <li key={index}>{bullet}</li>
            ))}
          </ul>
        </div>
      </div>
      <div className="experience-card">
        <div className="experience-image">
          <img src={experience2.companylogo} alt={experience2.company} />
        </div>
        <div className="experience-details">
          <h3>{experience2.company}</h3>
          <p>{experience2.role}</p>
          <p>{experience2.date}</p>
          <ul>
            {experience2.descBullets.map((bullet, index) => (
              <li key={index}>{bullet}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Experience;
